row3 = foreach result generate null as 'SalesAgreementProduct.SalesAgreementId', null as 'SalesAgreementProduct.SalesAgreement.Name', 0 as 'A', 0 as 'B', 0 as 'C', "A3" as RowNumber;
row4 = foreach result generate null as 'SalesAgreementProduct.SalesAgreementId', null as 'SalesAgreementProduct.SalesAgreement.Name', 0 as 'A', 0 as 'B', 0 as 'C', "A4" as RowNumber;

